import React from 'react';
import './App.css';
import Header from "./components/Header";
import Main from "./components/Main";
import Footer from "./components/Footer";

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            activePage: 'Home'
        }
    }

    render() {
        return (
            <div className='container-fluid'>
                <Header/>
                <Main/>
                <Footer/>
            </div>
        );
    }
}

export default App;
